import React from 'react';
import { NavLink } from 'react-router-dom';
import Footer from '../components/Footer';
import Navigation from '../components/Navigation';

const Mochi = () => {
    return (
        <div className="mochi">
            <Navigation />
            <div className="container">
            <h2>Mochi</h2>
            <div className="cat6">
            <div className="img-cat6"></div>
            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Officiis voluptates, beatae inventore libero placeat temporibus corrupti minima blanditiis reiciendis ad impedit consequuntur atque unde exercitationem explicabo. Temporibus error ullam eaque repellat exercitationem mollitia earum nisi quaerat officia, nobis, iure natus.</p>
            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Quod quasi omnis vero quia consequatur eveniet sequi culpa voluptate ullam excepturi.</p>
            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Amet provident hic eius maiores dolorem sequi, commodi, molestiae aspernatur mollitia laborum deleniti culpa? Iure qui eum in repudiandae quia numquam beatae magnam, minima consectetur sunt harum magni temporibus voluptates fugiat facilis ab.</p>
            </div>
            <div className="container-previous">
                <NavLink to="/grisou">
                <p>← Précédent</p>
                </NavLink>
            </div>
            <div className="container-next">
                <NavLink to="/">
                <p>Suivant →</p>
                </NavLink>
            </div>
            </div>
           <Footer />
        </div>
    );
};

export default Mochi;
